To investigate the charge-transfer characteristics of various CEs on the electrode/electrolyte interface, EIS analysis are performed on the symmetric cells consisting two identical electrodes. To carry out EIS experiments, symmetric cell was constructed with 400-MoO3, 500-MoO3, 600-MoO3 and Platinum CEs. It is employed to analyse the interfacial charge transfer process and electrocatalytic activity of DSSC. Figures 7 and 8 represents EIS studies of (a) 400-MoO3, (b) 500-MoO3, (c) 600-MoO3 and (d) Platinum CEs by Nyquist and Bode plots and these parameters are shown in Table 2.Fig.7
