As the other catalytic information of EIS measurement, Bode-phase plot can provide the electron lifetime (τ). The lower electron lifetime indicating that electrons from external circuit are quickly transferred to the electrolyte for regenerating I− ions, i.e. the electrode holds superior catalytic ability. Figure 8 shows the Bode phase plots obtained for 400-MoO3, 500-MoO3, 600-MoO3 and Platinum CEs based DSSCs. The maximum frequency of the characteristic frequency peak obtained from the bode phase plots for 400-MoO3, 500-MoO3, 600-MoO3 and Platinum are 7943.282, 2511.886, 6309.573 and 12,589.25 Hz respectively. The electron lifetime was calculated from the following equation.τn=12πfmax\documentclass[12pt]{minimal}
